import {
  BrowserRouter,
  Routes,
  Route,
  NavLink,
  useLocation,
  useNavigate
} from "react-router-dom";
import { useEffect, useState } from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  ResponsiveContainer
} from "recharts";

/* ---------- AUTH & ROLE ---------- */
const ROLE = "ADMIN"; // change to VIEWER to test role-based tabs

const authHeader = {
  Authorization: "Basic " + btoa("admin:admin123"),
  "Content-Type": "application/json"
};

/* ---------- UTILS ---------- */
const fetchJson = (url, setter) => {
  fetch(url, { headers: authHeader })
    .then(res => res.json())
    .then(setter)
    .catch(console.error);
};

const formatUptime = s =>
  `${String(Math.floor(s / 3600)).padStart(2, "0")}:${String(
    Math.floor((s % 3600) / 60)
  ).padStart(2, "0")}:${String(s % 60).padStart(2, "0")}`;

/* ---------- NAV CONFIG ---------- */
const allTabs = [
  { path: "/", label: "Home", icon: "üè†", roles: ["ADMIN", "VIEWER"] },
  { path: "/health", label: "Health", icon: "ü©∫", roles: ["ADMIN", "VIEWER"] },
  { path: "/metrics", label: "Metrics", icon: "üìä", roles: ["ADMIN"] },
  { path: "/uptime", label: "Uptime", icon: "‚è±", roles: ["ADMIN"] }
];

const tabs = allTabs.filter(t => t.roles.includes(ROLE));

/* ---------- COMPONENTS ---------- */

const Navigation = ({ dark }) => {
  const navigate = useNavigate();
  const location = useLocation();

  // Persist last tab
  useEffect(() => {
    localStorage.setItem("lastTab", location.pathname);
  }, [location.pathname]);

  // Keyboard navigation
  useEffect(() => {
    const h = e => {
      const i = tabs.findIndex(t => t.path === location.pathname);
      if (e.key === "ArrowRight" && i < tabs.length - 1)
        navigate(tabs[i + 1].path);
      if (e.key === "ArrowLeft" && i > 0) navigate(tabs[i - 1].path);
    };
    window.addEventListener("keydown", h);
    return () => window.removeEventListener("keydown", h);
  }, [location.pathname, navigate]);

  return (
    <nav style={{ ...styles.nav, background: dark ? "#020617" : "#f8fafc" }}>
      {tabs.map(t => (
        <NavLink
          key={t.path}
          to={t.path}
          end
          style={({ isActive }) => ({
            ...styles.navItem,
            ...(isActive ? styles.activeTab : {}),
            color: dark ? "#e5e7eb" : "#1e293b"
          })}
        >
          {t.icon} {t.label}
        </NavLink>
      ))}
    </nav>
  );
};

/* ---------- TABLE ---------- */
const DataTable = ({ data }) => (
  <table style={styles.table}>
    <tbody>
      {Object.entries(data || {}).map(([k, v]) => (
        <tr key={k}>
          <td style={styles.key}>{k}</td>
          <td style={styles.value}>{String(v)}</td>
        </tr>
      ))}
    </tbody>
  </table>
);

/* ---------- PAGES ---------- */

const Home = () => (
  <>
    <h2>üöÄ Admin Dashboard</h2>
    <p>Role: <b>{ROLE}</b></p>
    <p>Use tabs or ‚Üê ‚Üí keys</p>
  </>
);

const Health = () => {
  const [data, setData] = useState({});
  useEffect(() => fetchJson("http://localhost:8080/health", setData), []);
  return <><h2>ü©∫ Health</h2><DataTable data={data} /></>;
};

const Uptime = () => {
  const [sec, setSec] = useState(0);
  useEffect(() => {
    const load = () =>
      fetch("http://localhost:8080/uptime", { headers: authHeader })
        .then(r => r.json())
        .then(d => setSec(d.uptimeSeconds));
    load();
    const i = setInterval(load, 5000);
    return () => clearInterval(i);
  }, []);
  return <><h2>‚è± Uptime</h2><div style={styles.uptime}>{formatUptime(sec)}</div></>;
};

/* ---------- LIVE METRICS (WebSocket simulation) ---------- */
const Metrics = () => {
  const [points, setPoints] = useState([]);

  useEffect(() => {
    const i = setInterval(() => {
      setPoints(p => [
        ...p.slice(-9),
        { time: new Date().toLocaleTimeString(), memory: 200 + Math.random() * 300 }
      ]);
    }, 2000);
    return () => clearInterval(i);
  }, []);

  return (
    <>
      <h2>üìä Live Memory Usage</h2>
      <ResponsiveContainer width="100%" height={300}>
        <LineChart data={points}>
          <XAxis dataKey="time" />
          <YAxis />
          <Tooltip />
          <Line type="monotone" dataKey="memory" stroke="#3b82f6" />
        </LineChart>
      </ResponsiveContainer>
    </>
  );
};

/* ---------- APP ---------- */

export default function App() {
  const [dark, setDark] = useState(
    localStorage.getItem("dark") === "true"
  );

  useEffect(() => {
    localStorage.setItem("dark", dark);
  }, [dark]);

  return (
    <BrowserRouter>
      <div style={{ ...styles.page, background: dark ? "#020617" : styles.page.background }}>
        <div style={{ ...styles.card, background: dark ? "#020617" : "#fff", color: dark ? "#e5e7eb" : "#020617" }}>
          <Navigation dark={dark} />

          <button style={styles.darkToggle} onClick={() => setDark(!dark)}>
            {dark ? "‚òÄ Light" : "üåô Dark"}
          </button>

          <div style={styles.content}>
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/health" element={<Health />} />
              <Route path="/metrics" element={<Metrics />} />
              <Route path="/uptime" element={<Uptime />} />
            </Routes>
          </div>
        </div>
      </div>
    </BrowserRouter>
  );
}

/* ---------- STYLES ---------- */

const styles = {
  page: {
    minHeight: "100vh",
    background: "linear-gradient(135deg,#667eea,#764ba2)",
    padding: "30px",
    fontFamily: "Segoe UI, sans-serif"
  },
  card: {
    maxWidth: "1000px",
    margin: "auto",
    borderRadius: "16px",
    padding: "20px",
    boxShadow: "0 30px 60px rgba(0,0,0,0.4)"
  },
  nav: {
    display: "flex",
    gap: "10px",
    padding: "10px",
    borderRadius: "10px"
  },
  navItem: {
    padding: "8px 14px",
    borderRadius: "8px",
    textDecoration: "none",
    fontWeight: 500
  },
  activeTab: {
    background: "#3b82f6",
    color: "#fff"
  },
  content: {
    marginTop: "20px"
  },
  table: {
    width: "100%",
    marginTop: "15px",
    borderCollapse: "collapse"
  },
  key: {
    padding: "10px",
    fontWeight: "bold",
    background: "#f1f5f9"
  },
  value: {
    padding: "10px"
  },
  uptime: {
    fontSize: "28px",
    marginTop: "20px"
  },
  darkToggle: {
    float: "right",
    marginTop: "10px",
    cursor: "pointer",
    borderRadius: "8px",
    padding: "6px 12px"
  }
};
